import React from 'react';
import Chips from '../Chips/Chips';

const Style = {
    picture: {
        height: 220
    }
}

function Project(props) {
    return (
        <div className="myproject">

            <img 

                src={props.imgUrl} 
                alt="project" 
                style={Style.picture}/>

        </div>
    );
}

export default Project
